import React from 'react'


const Toppings = ({toppingsVeg, toppingsNonVeg, toppingsCheese, size, crust}) => {
    
  return (
    <div>
      {toppingsVeg.map(item => item.price)}
    </div>
  )
}

export default Toppings

Toppings.defaultProps ={
    toppingsVeg: [{BellPeppers:{price: 15}},{Onions:{price: 15}},{Mushrooms:{price: 20}}],
    toppingsNonVeg: [{Pepperoni:{price: 40}},{Sausage:{price: 50}},{Chicken:{price: 80}}],
    toppingsCheese: [{Mozzarella:{price: 30}},{Cheddar:{price: 25}},{Feta:{price: 45}}],
    size: [{Small: {price:200}},{Medium: {price:300}},{Large: {price:400}}],
    crust: [{thincrust:{price: 10}},{thickcrust:{price: 20}},{stuffedcrust:{price: 30}},{wholewheat:{price: 40}}]
}
